import React, { Component } from "react";

class Rules extends Component {
  render() {
    return (
      <div className="rulesContainer">
        <h2>How To Play</h2>
        <h4>#WhatDoYouCryptoMeme is a never ending game for meme (and blockchain)
        lovers, that allows people to be rewarded for their sense of humor.
        </h4>
        <p>A blockchain based version of the card game What Do You Meme</p>
      </div>
    );
  }
}

export default Rules;
